import React from 'react';
import ProjectCard from './components/ProjectCard';
import Resume from './components/Resume';
import './App.css';

function App() {
  const projects = [
    { title: 'Project 1', description: 'A brief description of project 1.', link: 'https://example.com' },
    { title: 'Project 2', description: 'A brief description of project 2.', link: 'https://example.com' },
  ];

  return (
    <div className="App">
      <header>
        <h1>My Portfolio</h1>
        <nav>
          <a href="#home">Home</a>
          <a href="#about">About</a>
          <a href="#portfolio">Portfolio</a>
          <a href="#resume">Resume</a>
          <a href="#contact">Contact</a>
        </nav>
      </header>
      <main>
        <section id="home">
          <h2>Welcome to My Portfolio</h2>
          <p>Hi, I'm [Your Name], a [Your Profession]. Explore my work below!</p>
        </section>
        <section id="about">
          <h2>About Me</h2>
          <p>Write about your background, skills, and achievements here.</p>
        </section>
        <section id="portfolio">
          <h2>My Projects</h2>
          <div style={{ display: 'flex', justifyContent: 'center', flexWrap: 'wrap' }}>
            {projects.map((project, index) => (
              <ProjectCard
                key={index}
                title={project.title}
                description={project.description}
                link={project.link}
              />
            ))}
          </div>
        </section>
        <section id="resume">
          <h2>Resume</h2>
          <Resume />
        </section>
        <section id="contact">
          <h2>Contact Me</h2>
          {/* Add contact form later */}
        </section>
      </main>

    </div>
  );
}

export default App;
